import React from 'react';
import {ReactComponent as LogoE} from '../../Images/LogoE.svg';
import { Parallax } from 'react-scroll-parallax'

function Logo() {
    return (
        <div>
            <Parallax>
                <LogoE width="105px" height="150px" fill="whitesmoke"/>
            </Parallax>
        </div>
    );
}

export default Logo;
